import './Name.css';

function Name() {
  return (
    <div className="Name">
        <form id="name_form">
            <label for="name">Name</label>
            <input type="text" name="name" />
            <input type="submit" value="Submit" />
        </form>
    </div>
  )
}

  export default Name
